import { subscribeToTimer } from './socket.js';
import React, {Component} from 'react'
class ChatTEST extends Component{
  constructor(props) {
    super(props);
    subscribeToTimer((err, timestamp) => this.setState({
      timestamp
    }));
    state = {
      timestamp: 'no timestamp yet'
    };
  }
}
